  sanitizeEquations = (obj: CustomFabricObject, action: string) => {
    switch (action) {
      case "scale":
        obj.widthEquation = undefined
        obj.heightEquation = undefined
        break
      case "scaleX":
        obj.widthEquation = undefined
        break
      case "scaleY":
        obj.heightEquation = undefined
        break
      default:
        break
    }
  }

